import './index.css';
import React from 'react'

export default class Footer extends React.Component {
    render() {
        const {todos} = this.props.state
        console.log(todos)
        const doneLength = todos.filter((item)=>{
            return item.flag === true
        }).length
        return (<div>
                  <input type ='checkbox'/> 

                  Done {doneLength}/{todos.length}
                </div>)
    }
}
